    - "史莱辛格"
    - "史莱辛格"
    - "<p>Slazenger（史莱辛格）源自英国贵族品牌，始创于1881年，为英国皇室专用品牌。Slazenger品牌的自我要求甚高、非常严格，在整个世纪以来成为高要求人士所爱戴的牌子。这归功于Slazenger追求卓越的质量。
      Slazenger手表同样是倍受瞩目,选用精钢材料,细致工艺打磨。设计简约而不失时尚,Slazenger手表将传统制作工艺与简洁舒适高雅设计结合在一起，是全球追捧的一大时尚手表品牌。</p>\r\n"
