    - "巴蒂珂"
    - "巴蒂珂"
    - "<p>瑞士表家族品牌BADEC(巴蒂珂)表 该品牌由瑞士BANOV家族创建于1985年。瑞士BADEC(巴蒂珂)表以其典雅的外 观、卓越的品质和独有的专业技能在瑞士本土和国际市场赢得了良好的声誉。瑞士BADEC(巴蒂珂)表是表界唯一集美学、现代科技、古典学于一体的家族品牌。
      巴蒂珂(BADEC) 低调奢华 高性价 您的满意是BADEC（巴蒂珂）不懈的追求！</p>\r\n"
