    - EZON
    - "<p>2008年，EZON宜准作为运动表品牌，整合中外知名设计师及设计研发团队，一切以高起点、高标准为要求，集运动表、可穿戴智能技术、与云服务平台于一身，提供运动数据感知服务、个人运动管理服务和运动社区服务，为运动爱好者带来个性鲜明、功能强大的智能运动表。EZON宜准研发的每一款产品，外观及简且品质精细，将动感与时尚完美融合，秉承品牌核心理念&ldquo;体验智慧运动&rdquo;的不懈追求，立志成为中国智能运动表领跑者。</p>\r\n"
