    - "宝仕奥莎"
    - "宝仕奥莎"
    - "<p>&ldquo;宝仕奥莎的历代大师级工匠一直以来都投身于水晶切割事业。自1948年成立以来，宝仕奥莎延续了波希米亚北部百年的水晶制造传统。60年来，我们一直享负盛名。如今，我们在生产过程中只采用最先进的技术。我们以生产机器切割的水晶配件着称。在珠宝交易中，宝仕奥莎品牌就是品质的象征，在全球享有盛誉。选择宝仕奥莎作为供应商，就等于寻得了一位可靠的合作伙伴&rdquo;。</p>\r\n"
    - 2014
