    - "北京"
    - "北京"
    - "<p>北京手表厂成立于1958年，位于北京的后花园&mdash;&mdash;昌平。工厂坐北朝南，背倚军都山，鸟瞰温榆河。半个世纪以来，北京手表厂浸润古都文化，沐泽人杰地灵，探究钟表艺术，挑战工艺极限。建厂至今，北京手表厂已累计生产、销售手表和机心超过2200万只，掌握了陀飞轮、双陀飞轮、陀飞轮三问、双轴立体陀飞轮、双发条盒长动力等高复杂手表的设计制造技术，精熟于微雕、镂空、珐琅、贵金属加工及宝石镶嵌等高级手表的生产制作工艺，拥有三位国家级制表大师，成为拥有完全自主知识产权和高级手表核心技术的手表制造商。</p>\r\n"
    - 2014
