    - "天王表"
    - "天王表"
    - "<p>天王表创牌于1988年，是国内著名腕表领导品牌，采用皇冠造型作为品牌标志，尊贵典雅、简洁明了。目前，天王表已在全国建立起了庞大的营销网络，并设立了多个维修服务中心。经过二十多年发展，天王表设计生产出了天爵陀飞轮系列、传奇系列、锋尚系列、金骑士系列、轮时代系列、尚&middot;SHINE系列等多个系列经典腕表，深受各界人士欢迎。</p>\r\n"
