    - "洲进"
    - "<p>品牌介绍:东莞市洲进钟表有限公司，是一家专业研发、生产智能电波钟机芯和GPS成品手表的制造企业，电波钟及电波计时系列产品是继石英电子钟之后的新一代高科技产品，它的出现开拓了时间计量的新量程，从此全国只有一个标准时间---北京时间。</p>\r\n"
