    - "飞亚达"
    - "飞亚达"
    - "<p>飞亚达，成立于1987年。自品牌创立伊始，飞亚达始终以谦虚而富有远见的目光，专注于&ldquo;钟表&rdquo;这个古老而又注定不断创新的行业。26年砥砺前行，飞亚达已成为中国腕表领导品牌，并逐步成为活跃在世界表坛的国际品牌。2011年，飞亚达进驻瑞士巴塞尔钟表展1号馆国际品牌馆，成为该馆唯一一个源自中国的国际腕表品牌。
      每一只飞亚达表，在严谨精致的设计、制作和组装中，在亲身深入的盛事和文化中，不但凝聚着艺术的审美价值、舒适的佩戴感受，更承载着与佩戴者相呼应的内蕴精神。飞亚达品牌，从&ldquo;一旦拥有，别无所求&rdquo;到&ldquo;心在更远处&rdquo;，始终以&ldquo;进取&rdquo;为精神倡导，矢志前行。</p>\r\n"
    - 2014
