  - - 10
    - "力抗"
    - "力抗"
    - "<p>LICORNE（力抗）品牌源自于意大利，1986年，台湾翡仕钟表获得力抗钟表品类经营授权并在次年将力抗手表品牌纳入翡仕旗下成为台湾本土品牌，创造了市场话题及销售佳绩。LICORNE表融合东西方的流行趋势及设计美学，为台湾流行腕表带来新的惊奇和更高的价值。在上世纪九十年代初荣获&ldquo;巴塞罗那奥运会中华台北奥运代表团指定计时荣誉&rdquo;，为台湾流行腕表品牌翻开崭新的一页。现如今，台湾力抗品牌通过飞亚达销售有限公司独家代理进入大陆市场，台湾席卷20多年的流行风潮将带给国人不一样的惊喜。</p>\r\n"
    - 2014
