    - "威灵顿"
    - "威灵顿"
    - "<p>源自英国1883年的&ldquo;威灵顿&rdquo;品牌是佛山市南海区美致实业有限公司经营的一个高档时钟品牌，经英国授权作为中国生产商和独家代理商。产品包括挂钟，台钟和落地大钟，材质以实木为主，采用品质优秀的机芯。产品款式多样，设计新颖，工艺精湛，品牌创立以来获得全国很多经销商以及行家的认可和肯定。</p>\r\n"
