    - "恒晖"
    - "恒晖"
    - "<p>广州利宝钟表有限公司，成立于1994年，是一家从事钟表及其相关仪器的开发、设计、生产、销售的合资企业，公司有着先进的经营管理理念和管理模式以及丰富的制造经验的支持，凭借专业的开发设计团队及国外先进的设备技术，不断开拓创新，走在钟表行业的最前端，所制造的产品新颖独特且品质优异，目前已有过千个产品款色投向市场，除部分国内销售外其它产品出口美国、俄罗斯、德国、加拿大、瑞士、乌拉圭、日本等十多个国家。制造品牌包括：SHARP、BIGBEN、DISNEY等，钟类产品有双铃闹钟、电子闹钟、特色台钟、挂钟等。2011年公司继续扩大规模，在国内前所未有的市场领域大力投放研发资金，制造出扭转时钟机芯界传统手工调试作业模式的机芯闹点定位仪，并在内测中得到较高的评价，2012年将全面投放市场。</p>\r\n"
    - 2014
