    - "捷瑞时"
    - "捷瑞时"
    - "<p>日本精工电子在生产机械表的领域上，已经有超过70年的历史了。J.SPRINGS机械表系列传承了这种精神。最新的&ldquo;J&rdquo;系列腕表则秉承着新的理念：回归基础，从而诞生了这款传统但是对于本品牌来讲，有时全新的自动机械腕表。该系列腕表，全部由日本生产，制造。
      品牌风格：J.Springs（捷瑞时）腕表 动力魅力集于一身！风格自成一派，充满时尚动力、深受日本、欧美和亚洲消费者欢迎的&ldquo;J.Springs&rdquo;（捷瑞时）腕表。</p>\r\n"
