  - - 15
    - "三宅一生"
    - "三宅一生"
    - "<p>三宅一生 三宅一生 (Issey Miyake) 的创始人 Issey Miyake 先生，1970年在东京成立了三宅一生设计室。三宅一生 (Issey
      Miyake) 设计的褶皱面料可以随意一卷，捆绑成一团，不用干洗熨烫，要穿的时候打开，依然是平整如新。这是服装面料上的一次革命性事件。三宅一生 (Issey
      Miyake) 凭着奇特皱褶的面料，在才子如云的巴黎时装界站稳了脚跟。40年来，三宅一生曾获得日本时装编辑俱乐部奖、MAINICHI设计奖(凭&ldquo;一块布&rdquo;设计获奖，也是该奖项第一次颁给时装设计师)、纽约布莱克学院奖、美国时装设计师协会奖、时装奥斯卡等多项奖项。1997年更荣获日本政府颁布紫绶带奖章
      三宅一生腕表是世界最著名的腕表设计品牌，款式是世界顶级设计师精心设计和打造的，每个系列都有不同的表现和故事。而当中最多人熟悉，相信就是深泽直人的系列款式了。
      TWELVE 系列腕表。它没有任何数字标记，用表盘自身的12个角表达时间，时针分针也粗细相同。 TWELVE365系列，小表盘上分别显示星期、日期和秒，就像人脸一样，展示不同的表情，十分有趣</p>\r\n"
    - 2014
