  - - 16
    - "罗蒂诗蔓"
    - "罗蒂诗蔓"
    - "<p>罗蒂诗蔓品牌介绍： 罗蒂诗蔓是源自法国的时尚浪漫品牌，品牌起源于品牌创始人路易和罗莲之间曲折、坚定的爱情经历，两个人的恋情经过13年的分离和风雨后，最终能够重逢并走到了一起。在他们的共同努力下创造了一个新的腕表品牌，他们选用LOTUSMAN作为产品的品牌具有深层的内涵。LOTUS（莲花）是洁白无瑕、极尽善美的代表，路易将品牌定名罗蒂诗蔓，代表极尽善美的人生和爱情，希望产品的佩戴者都像他们一样，能够得到幸福。品牌缘起于法国，传承了法国时尚、浪漫的血统；品牌发展于瑞士，继承了瑞士制表的精湛技术，使品牌的产品实现了完美与精密的结合。</p>\r\n"
    - 2014
