      　　艾力舍将德国60年代的顶级赛车手GRAF BERGHE VON TRIPS的传奇人生融入品牌文化，使其成为品牌的精神代言，彰显了手表不只是一个生活配饰，更是一个人风格声明的品牌内涵。另一位德国F1赛车前领军人物JOCHEN
