  - - 74
    - "帝达时"
    - "帝达时"
    - "<p>Tierxda（帝达时）手表 － 百年品牌故事 源自瑞士 创于英国 立足香港 面向全球 1832年，路易－法郎说－卡帝亚（Louise-Francois-Cartier）出生于瑞士日内瓦的一个贵族家庭。
      1868年，路易－法郎说－卡帝亚（Louise-Francois-Cartier）在瑞士创立了卡帝亚珠宝公司。 1902年，路易－法郎说－卡帝亚（Louise-Francois-Cartier)80周岁时，受邀参与英国国王爱得华七
      世加冕典礼筹备，其儿子参与设计并获得皇室珠宝商称号。 1908年，帝亚达时在英国伦敦创制了有史以来的第一只腕表 1918年，帝亚达时第一只圆形女装腕表问世。
      1928年，帝亚达时的主题产品有：钟表、珠宝首饰、皮具、配鉓和香水。 1938年，帝亚达时的手表产品风格是领导欧洲潮流的方向标。 1939年，9月1日第二次世界大战爆发，为了躲避战争，路易－法郎说－帝亚达时（Louise-Francois-
      Tierxda）从英国伦敦将公司搬到当时还是英国殖民地的香港。并在香港注册专用于手表的 新商标Tierxda,产品一直销往欧美市场。。 1997年，香港回归中国，Tierxda商标被香港威妮华钟表有限公司收购。
      2003年，Tierxda手表正式进入中国内陆市场。开始了Tierxda（帝达时手表）的新篇章&hellip;&hellip; 2012年， 为了进一步开拓国内市场，总公司决定在广州市成立子公司-广州市帝达时钟表有限公司，全面负责内地市场的一切事务。</p>\r\n"
    - 2014
