    - "<p>深圳兴华宾馆是一家经济型的商务酒店。酒店座落于深圳市深南中路燕南路口处，华强北商业、购物核心区域，距330机场巴士起点站和科学馆地铁站步行仅三分钟，地处优越地段，交通非常便利。深圳兴华宾馆设有标准房、豪华房、三人房和套房等各色房间。房间布置温暖惬意，配备32寸液晶电视、超大花洒淋浴、免费宽频及无线上网等设施设备。酒店同时设有会议室、商务中心、棋牌室和保健中心等商务、休闲设施。宾馆开业二十多年来，不断强化&ldquo;真诚服务每一天&rdquo;的服务理念。深圳兴华宾馆老绍兴酒楼是深圳唯一的一家正综绍兴菜，绍兴菜之美，在于风味纯朴雅正，自然本色，讲究物料的鲜，更要求徒物料的活，喜用现摘、现割、现杀、现烧、现吃，原汁原味，清鲜时鲜。绍兴菜之美，在于风味富有变化，蕴含周易阴阳辩证之法，变化创新，巧取变味成美味，浓淡适中，发酵成鲜乃至可化平淡为奇香，兴华宾馆绍兴酒楼已经成为一个公务接待和亲朋好友聚会的高雅食府。</p>\r\n\r\n<table
