    - "<p>深圳鹏威酒店位于罗湖区红宝路15号，地处深圳市金融中心区，紧靠华强北和东门两大商业圈，毗邻深圳最新标志性建筑京基100大厦、华润万象城购物广场、地王大厦、深圳书城、荔枝公园，位置优越，交通便利。<br
      />\r\n深圳鹏威酒店1楼为西餐厅可同时容纳80-100人同时就餐；2-3楼设有高级私房菜餐厅，17间VIP包，可容纳近300人；4楼设有280平设施齐全多功能会议室。是您商务旅行、会务接待及旅游观光的理想选择。</p>\r\n\r\n<table
