    - "<p>&ldquo;中国（深圳）国际钟表展览会&rdquo;简称&ldquo;深圳钟表展&rdquo;（CWCF），是中国内地最大规模的钟表珠宝类专业展会，于
      1988 年创展，现已连续举办 25 届，以钟表产品的丰富齐全、组织的专业化和国际化而著称，是继巴塞尔钟表展、香港钟表展之后的世界第三大钟表展会、中国最大的钟表类专业展会。</p>\r\n\r\n<p>自2010年开始，中国钟表协会与深圳市钟表行业协会达成共识，由中国（北京）国际钟表展和中国（深圳）国际钟表展览会两展合一，充分整合海内外资源，完美演绎中国国内唯一的国际大型专业钟表展展览会及国际钟表时尚交易平台。</p>\r\n\r\n<p>作为世界上最主要的钟表类产品的国际性采购盛会之一，以钟表产品的丰富齐全、组织的&ldquo;专业化、国际
      化、品牌化和时尚化&rdquo; ，被同业誉为&ldquo;中国钟表第一展&rdquo;。是海外钟表品牌进入中国市场的门户，是钟表业交流、洽谈、展示的最好平台和国际授权品牌展示的窗口，是中国钟表业的年度
      盛会和风向标。</p>\r\n\r\n<p>中国（深圳）国际钟表展览会 2004 年通过了国际展盟 UFI 认证，成为中国钟表行业内迄今唯一被国际展盟接纳的大型国际钟表专业展会。</p>\r\n\r\n<p><br
      />\r\n展会名称：第26届 中国（深圳）国际钟表展览会<br />\r\n展会时间： 2015年6月25-6月28日<br />\r\n展会地点：
      深圳会展中心（深圳市福田区福华三路）<br />\r\n参展企业： 500余家品牌企业<br />\r\n展馆位置： 1号馆和9号馆<br />\r\n组团区域：瑞士展团、德国展团、香港展团、台湾展团、山东展团等5大展团参展本届特点：1号馆将再度升级高端标准展位；9号馆将亮相智能手表展区<br
      />\r\n观众数据： 预计50,000人<br />\r\n展会面积： 45000㎡<br />\r\n门票价格： 专业观众网上申请免费入场券、普通观众票价RMB30元/人次。</p>\r\n\r\n<p>本展会属于专业性展会，谢绝16岁以下未成年人参观，70岁以上人士入馆需要成年人陪同。</p>\r\n"
  - - 37
    - 37
    - en
    - 2014-10-24 07:43:56.000000000 Z
    - 2014-12-29 16:01:29.000000000 Z
    - "<p>表 类：机械表、石英表、多功能表、礼品表、电子表、怀表、金属表、运动表、运动秒表</p>\r\n\r\n<p>钟 类：电波钟、石英钟、机械钟、台钟、挂钟、闹钟、落地钟、留声机、多功能钟</p>\r\n\r\n<p>机
      心：机械机心、石英机心、机械钟心、石英钟心、 数码信息历机心、 电波机心</p>\r\n\r\n<p>数码信息历：数码信息历、灯箱信息历、动感画信息历</p>\r\n\r\n<p>配
      件：表面、表壳、表针、把的、表带等；包装产品；钟表珠宝生产设备、工具</p>\r\n\r\n<p>钟表生产设备：自动化装表机械设备、钟表精密测试设备、钟表钻孔机、钟表雕刻机等钟表类相关机械设备</p>\r\n"
