    - "<p>由深圳市钟表行业协会发起的中国钟表高峰论坛，主旨是为了分析了解中国钟表产业的现状；掌握国内宏观政策、商业环境等因素对行业发展的影响；解决钟表行业
      和企业面对的切实问题和（研究、推广）研究国外的先进文化推广及营销经验；为中国钟表行业的未来发展提供指导性意见。每届中国钟表高峰论坛邀请来自海内外 友好商会代表、政府领导和学术届的专家、著名企业和媒体的代表
      , 针对钟表行业的现状、市场环境、营销管理、未来动向、品牌战略、知识产权等多个热门问题进行探讨。</p>\r\n"
