    - "<p>明轮，是一种船用推进器，置于船体两侧或尾部，形似车轮，在轮周上装若干桨板，拨水向后使船前进，因轮之大部分在水面以上，故称&ldquo;明轮&rdquo;。天王&ldquo;轮时代&rdquo;系列腕表的设计灵感正来源于此。</p>\r\n\r\n<p>明轮再启，引领时代。19世纪，西方广泛使用明轮，由此，装有明轮的蒸汽机船开始引领新的蒸汽时代；2009年，天王&ldquo;轮时代&rdquo;系列应运而生，以新的内涵，从记录时间的腕表，跃升为歌颂勇气、智慧、完美、探索精神的&ldquo;明轮&rdquo;，开辟了腕表时代的新里程碑；2014年，天王致献经典，重新演绎&ldquo;轮时代&rdquo;系列腕表，向开创进取、执着追求的时代&ldquo;明轮&rdquo;精神和灵感设计致敬，亦为品牌永恒传递的积极进取之贵族精神赋予和书写更丰富、更深层次的内涵。</p>\r\n\r\n<p>承袭英伦经典设计风范，轮时代系列新款以优雅内敛的皮革表带和不锈钢带装点别样复古情怀，盘面不同时位的&ldquo;明轮&rdquo;，于时光流淌中恒久演绎时代之开创进取精神，简约利落的劈花字钉与优雅指针浑然一体，而深邃油压纹似远航轮船动力极致轮转状态之生动呈现，又如另一隐形动态&ldquo;明轮&rdquo;与盘面不同时位的静态&ldquo;明轮&rdquo;交相辉映，亦动亦静，以坚定执着之心记录时光的咏叹调。</p>\r\n"
