    - "<p style=\"text-align:center\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>第</strong><strong>8</strong><strong>届中国钟表高峰论坛</strong></span></p>\r\n\r\n<p><span
      style=\"font-family:arial,helvetica,sans-serif\"><strong>时间：</strong>2010年7月1~3日&nbsp;<br
      />\r\n<br />\r\n<strong>地点：</strong>&nbsp;深圳会展中心１号馆<br />\r\n<br />\r\n<strong>主题：</strong>八方对话：钟表产业，突破困局&nbsp;<br
      />\r\n2010年&ldquo;第八届中国钟表高峰论坛&rdquo;，以&ldquo;八方对话：钟表产业，突破困局&rdquo;为主题，继续与&ldquo;中国（深圳）国际钟表展&rdquo;同期举行。对话嘉宾来自四面八方，对话主题涉及时钟业、手表业、钟表市场的未来展望、精密制造提升附加值的讨论、钟表行业设计文化的探索、中国商务手表的发展、电子商务在钟表行业的实践思考以及钟表行业的数据发布等六场高峰对话的八场讨论。&ldquo;如何打开我们在产业升级的进程中面临的困局？&rdquo;他们的思想碰撞将为钟表行业带来更多理性思考和启示。</span><br
      />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><strong>详细议题：</strong>&nbsp;</span><br
      />\r\n<br />\r\n<span style=\"font-size:12px\"><strong>议题一</strong>&nbsp;：大中华区钟表商会&quot;会长高峰对话&quot;&nbsp;<br
      />\r\n<strong>议题二</strong>&nbsp;：精密制造，提升附加值，延伸钟表技术&nbsp;<br />\r\n<strong>议题三</strong>：中国钟表&mdash;从模仿到原创&nbsp;<br
      />\r\n<strong>议题四</strong>&nbsp;：谁来引领中国商务手表的未来<br />\r\n<strong>议题五</strong>&nbsp;：E时代钟表网络营销实践与探索<br
      />\r\n<strong>议题六</strong>&nbsp;<strong>：</strong>中国百家商场（专卖店）钟表零售监测信息发布会暨积极探索中国自主钟表品牌发展的创新模式&nbsp;</span><br
      />\r\n&nbsp;</p>\r\n"
