    - "<div id=\"map-container\">&nbsp;</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img
      alt=\"图形1\" class=\"selected_by_wym\" src=\"/system/images/W1siZiIsIjIwMTQvMTEvMTkvMTRfMjVfNDFfMjQ2X18xLnBuZyJdLFsicCIsInRodW1iIiwiNDUweDQ1MFx1MDAzRSJdLFsicCIsInN0cmlwIl1d/%E5%9B%BE%E5%BD%A21.png\"
      style=\"height:392px; width:500px\" title=\"图形1\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>一、主要公交车路线</strong></p>\r\n\r\n<p><strong>会展中心东门（金田路）：</strong><br
      />\r\n<span style=\"font-size:12px\"><span style=\"font-family:comic sans ms,cursive\">K113路：梧桐苑&mdash;&mdash;会展中心东&mdash;&mdash;蛇口码头总站</span></span><br
      />\r\n<strong>会展中心北门（福华三路）：</strong><br />\r\n<span style=\"font-size:12px\"><span
      style=\"font-family:comic sans ms,cursive\">50路：下沙&mdash;&mdash;会展中心&mdash;&mdash;清水河<br
      />\r\n64路：福田交通枢纽&mdash;&mdash;会展中心&mdash;&mdash;布心山湖居<br />\r\n80路：东角头总站&mdash;&mdash;会展中心&mdash;&mdash;百鸽笼地铁站<br
      />\r\n121路：皇岗口岸&mdash;&mdash;会展中心&mdash;&mdash;南山中心区总站<br />\r\n76区间路：车公庙公交总站&mdash;&mdash;会展中心&mdash;&mdash;梅林检查站<br
      />\r\n235路：皇岗口岸&mdash;&mdash;会展中心&mdash;&mdash;西丽留仙居<br />\r\n371路：民田总站&mdash;&mdash;会展中心地铁站&mdash;&mdash;南岭花园总站<br
      />\r\n374路：安托山总站&mdash;&mdash;会展中心&mdash;&mdash;澳头总站<br />\r\n375路：福田保税区&mdash;&mdash;会展中心&mdash;&mdash;澳头总站<br
      />\r\n379路：沙湾汽车站&mdash;&mdash;会展中心&mdash;&mdash;民田总站<br />\r\nK578路：福田交通枢纽&mdash;&mdash;会展中心&mdash;&mdash;公明汽车站<br
      />\r\nM223路：红山地铁口&mdash;&mdash;会展中心地铁站&mdash;&mdash;购物公园地铁站<br />\r\nM390路：石夏南总站&mdash;&mdash;会展中心&mdash;&mdash;梅林一村总站<br
      />\r\n机场9线：宝安机场&mdash;&mdash;会展中心&mdash;&mdash;皇岗口岸</span></span><br />\r\n<strong>会展中心西门（益田中路）</strong><br
      />\r\n<span style=\"font-size:12px\"><span style=\"font-family:comic sans ms,cursive\">64路：福田交通枢纽&mdash;&mdash;益田中路&mdash;&mdash;布心山湖居<br
      />\r\n71路：香蜜湖总站&mdash;&mdash;益田中路&mdash;&mdash;公交大厦总站<br />\r\n76区间路：车公庙公交总站&mdash;&mdash;益田中路&mdash;&mdash;梅林检查站<br
      />\r\n80路：东角头总站&mdash;&mdash;益田中路&mdash;&mdash;百鸽笼地铁站<br />\r\n235路：皇岗口岸&mdash;&mdash;益田中路&mdash;&mdash;西丽留仙洞<br
      />\r\n374路：安托山总站&mdash;&mdash;益田中路&mdash;&mdash;澳头总站<br />\r\nK359路：沙湾总站&mdash;&mdash;益田中路&mdash;&mdash;福田交通枢纽<br
      />\r\n高峰14号专线：李朗总站&mdash;&mdash;益田中路&mdash;&mdash;福田交通枢纽</span></span><br />\r\n<strong>会展中心南门（滨河大道）</strong><br
      />\r\n<span style=\"font-size:12px\"><span style=\"font-family:comic sans ms,cursive\">229路：宁水花园&mdash;&mdash;会展中心南&mdash;&mdash;深圳火车西站<br
      />\r\n337路：火车站&mdash;&mdash;会展中心南&mdash;&mdash;海上田园风光<br />\r\n338路：皇岗口岸总站&mdash;&mdash;会展中心南&mdash;&mdash;海上田园风光总站<br
      />\r\n353路：坪地汽车站&mdash;&mdash;会展中心南&mdash;&mdash;深圳火车西站<br />\r\n369路：布吉阳光花园&mdash;&mdash;会展中心南&mdash;&mdash;南头青青世界<br
      />\r\n382路：仙湖植物园&mdash;&mdash;会展中心南&mdash;&mdash;官龙村<br />\r\nJ1路：蛇口码头&mdash;&mdash;会展中心南&mdash;&mdash;大梅沙总站<br
      />\r\n高峰58号专线：福田交通枢纽&mdash;&mdash;会展中心南&mdash;&mdash;大梅沙总站</span></span></p>\r\n\r\n<p><br
      />\r\n<strong>二、从深圳机场到会展中心</strong></p>\r\n\r\n<p><strong>机场穿梭巴士-330路机场巴士</strong><br
      />\r\n<span style=\"font-size:12px\"><span style=\"font-family:comic sans ms,cursive\">330路机场巴士是从深圳机场至华联大厦，每10-15分钟一班，停靠站为投资大厦及华联大厦。全程耗时35分钟。您可以在投资大厦下车转搭的士，只需5分钟左右便可到达会展中心。</span></span><br
      />\r\n<strong>327路巴士</strong><br />\r\n<span style=\"font-family:comic sans
      ms,cursive\"><span style=\"font-size:12px\">327路是公共汽车，从深圳机场至深圳市区。每6分钟一班，最早的一班在早上6点。该巴士停靠站很多，您可以在竹子林站下车然后转乘地铁至会展中心。</span></span><br
      />\r\n<strong>355路巴士</strong><br />\r\n<span style=\"font-size:12px\"><span
      style=\"font-family:comic sans ms,cursive\">355路是公共汽车，从深圳机场至深圳市区。每10分钟一班，最早的一班在早上5点半。该巴士停靠站很多，您可以在南头检查站下车然后转乘M413路大巴至会展中心。</span></span></p>\r\n\r\n<p><strong>三、从香港机场到会展中心</strong></p>\r\n\r\n<p><span
      style=\"font-family:comic sans ms,cursive\"><span style=\"font-size:12px\">①香港机场&mdash;&mdash;九龙火车&mdash;&mdash;深圳罗湖火车站&mdash;&mdash;地铁&mdash;&mdash;深圳会展中心<br
      />\r\n②香港机场&mdash;&mdash;皇岗口岸（120元/张）&mdash;&mdash;深圳会展中心（的士15元左右）<br />\r\n③香港机场-----深圳会展中心直达巴士<br
      />\r\n永东巴士1号客运大楼接机大堂A08柜台<br />\r\nTel:(852)22610176,(86-755)86283967,86286011</span></span></p>\r\n\r\n<p><strong>四、深圳地铁：</strong></p>\r\n\r\n<p><span
      style=\"font-family:comic sans ms,cursive\"><span style=\"font-size:12px\">目前，地铁1号线-罗宝线(罗湖-机场)、地铁2号线-蛇口线(赤湾站-新秀站)、地铁3号线-龙岗线(益田站-双龙)、地铁4号线-龙华线(福田口岸-清湖)、地铁5号线-环中线(前海湾-黄贝岭)</span></span></p>\r\n\r\n<p><strong>五、温馨提示</strong></p>\r\n\r\n<p><strong>深圳市内交通：</strong><br
      />\r\n<span style=\"font-family:comic sans ms,cursive\"><span style=\"font-size:12px\">深圳的士起表价为13元，公交车2元起<br
      />\r\n①深圳罗湖火车站――地铁（3元）、的士（大概40元）――会展中心站<br />\r\n②深圳机场&mdash;&mdash;大巴K568（20元）到深圳火车站<br
      />\r\n③深圳机场&mdash;&mdash;大巴330（20元）到深圳华联大厦<br />\r\n④深圳机场&mdash;&mdash;市区的士（大概120元）<br
      />\r\n⑤乘座深圳地铁为单程票，地铁设有自动售票机，接收币种为人民币，自动售票机接收面值硬币（1元硬币）和纸币（五元纸币）。</span></span><br
      />\r\n<strong>公交和地铁查询电话</strong><br />\r\n<span style=\"font-family:comic sans
      ms,cursive\"><span style=\"font-size:12px\">深圳机场：0755-23456789 航班查询：27776666<br
      />\r\n公交服务热线查询：83161116 地铁服务热线查询：88960600<br />\r\n出租车电召服务：运发 95611 安达 26689333
      中南 83938000 运联通 83166666</span></span></p>\r\n\r\n<p><strong>六：展期免费穿梭巴士指引</strong>（待提供）</p>\r\n"
