    - "<p style=\"text-align:center\"><strong>2015年深圳钟表展&mdash;&mdash;整合保险价格及参保内容</strong></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">根据政府及会展中心管理条例，为了有效预防展期突发事故，减少由此带来的损失，凡参加本届展会的所有展商须购买展期保险，并签署《参加保险或承担风险承诺书》，详见《参展商手册》之《参展规则》第2.6条。为此，主办机构提供统一购买保险的服务，包含公众责任，财产一切险等，费用优惠，保障内容全面，参保费用标准及范围见下表：</span></span></p>\r\n\r\n<table
      border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:700px\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td
      style=\"text-align:center\">展位面积</td>\r\n\t\t\t<td style=\"text-align:center\">保险费</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td
      style=\"text-align:center\">50 平米及以下</td>\r\n\t\t\t<td style=\"text-align:center\">RMB450</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td
      style=\"text-align:center\">51~100平米</td>\r\n\t\t\t<td style=\"text-align:center\">RMB550</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td
      style=\"text-align:center\">101~250平米</td>\r\n\t\t\t<td style=\"text-align:center\">RMB880</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td
      style=\"text-align:center\">251~500 平米</td>\r\n\t\t\t<td style=\"text-align:center\">RMB1100</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p><strong>第一部分
      </strong><strong>会展责任保险</strong></p>\r\n\r\n<p><span style=\"font-size:14px\"><span
      style=\"font-family:comic sans ms,cursive\">一、保险责任</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">在保险期间内，被保险人或其雇请人员在保险单载明的展览场所进行展出工作、装卸展品、运转机器以及其他与展览相关的活动中，因疏忽或过失引起的下列各项损失或费用，依法应由被保险人承担的经济赔偿责任，保险人按照本保险合同约定负责赔偿：</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">（一）对于所租用展览场所的建筑物、各类固定设备及地面、地基的损失；</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">（二）被保险人雇请人员的人身伤亡；</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">（三）第三者的人身伤亡。</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">&nbsp;</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">二、责任限额</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">每次事故限额：RMB100万元；每人责任限额：RMB50万元；累计责任限额：RMB200万元</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>第二部分
      </strong><strong>展品损失保障</strong></p>\r\n\r\n<p><span style=\"font-size:14px\"><span
      style=\"font-family:comic sans ms,cursive\">（一）展品在展览场所参展期间因除外责任以外的自然灾害或意外事故（包含盗窃、抢劫）导致损毁或灭失，保险人按照合同约定负责赔偿。保险金额：20万元。</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">（二）扩展承保展品在被保险人营业场所与展馆之间往返运输期间，因自然灾害或意外事故导致的损毁或灭失。保险金额：10万元。</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>备注</strong>：</p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">1、本届展会保险顾问前海民太安保险经纪有限公司作为保险经纪服务机构，负责处理参展方保险索赔事宜。</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">2、本保险方案介绍仅供参考，不构成保险合同的一部分，具体保险责任和责任免除等详细内容，请参阅保险合同条款，并以其规定为准。</span></span></p>\r\n\r\n<p><span
      style=\"font-size:14px\"><span style=\"font-family:comic sans ms,cursive\">3、此保障标准为基本保障，各参展商可根据自身实际情况另行投保保险以充分转移相关风险。</span></span></p>\r\n"
