    - "<p><span style=\"font-family:times new roman,times,serif\">&nbsp;&nbsp;</span></p>\r\n\r\n<p
      style=\"text-align:center\"><span style=\"font-family:times new roman,times,serif\"><strong>第9届中国钟表高峰论坛</strong></span></p>\r\n\r\n<p><span
      style=\"font-family:times new roman,times,serif\"><strong>时间：</strong> 6.29<br
      />\r\n<br />\r\n<strong>地点：</strong>深圳星河丽思卡尔顿酒店&nbsp;<br />\r\n<br />\r\n<strong>主题：</strong>&ldquo;全球化下，中国钟表业的愿景&nbsp;<br
      />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; 作为本次中国.钟表文化周重要盛宴之一的第九届中国钟表高峰论坛于今日在深圳星河丽思卡尔顿酒店隆重举行。以&ldquo;全球化下，中国钟表业的愿景&rdquo;为主题，特邀来自瑞士、日本以及国内钟表行业各产业链的资深人士和瑞士驻华大使馆、深圳相关政府部门、媒体代表齐聚一堂，与您携手共进，谋新发展，以专业化和国际化水准进行一场国际钟表行业的巅峰对话。&nbsp;<br
      />\r\n<br />\r\n<strong>详细议题：</strong>&nbsp;<br />\r\n<br />\r\n<strong>议题一&nbsp;</strong>：亚洲机心业发展机遇<br
      />\r\n<strong>议题二&nbsp;</strong>：中国企业欧洲投资的战略&nbsp;<br />\r\n<strong>议题三&nbsp;</strong>：中国品牌离国际化还有多远&nbsp;<br
      />\r\n<strong>议题四&nbsp;</strong>：寻找中国市场伙伴 &mdash; 瑞士独立品牌核心要素及经验研究&nbsp;<br />\r\n<strong>议题五&nbsp;</strong>：时间同步系统对中国社会效率的影响---
      电波钟发展实务研讨&nbsp;</span></p>\r\n"
    - 0
    - 2015-01-27 09:33:31.000000000 Z
    - 2015-01-27 09:35:42.000000000 Z
  - - 208
    - 178
    - Body
    - "<p style=\"text-align:center\"><strong>第</strong><strong>10</strong><strong>届中国钟表高峰论坛</strong></p>\r\n\r\n<p><strong>时间：</strong>2012年6
      月 27 日&nbsp;<br />\r\n<br />\r\n<strong>地点：</strong>深圳市丽思卡尔顿大酒店&nbsp;<br />\r\n<br
      />\r\n<strong>主题：</strong>设计产业未来<br />\r\n<br />\r\n在今年论坛迎来十周年之际，主办机构再次云集来自瑞士、港台以及国内钟表行业的权威资深人士和深圳市相关政府部门及媒体代表、嘉宾，以规模和专业化、国际化水准，与业界各方携手进行国际钟表行业五场巅峰对话。本届论坛以&ldquo;设计产业未来&rdquo;为主题，从行业定位、发展模式、品牌元素、电子商务及产业设计等话题延伸，由经验总结、理念研究转型为关注趋势，致力于设计中国钟表业的未来&mdash;&mdash;研究、探讨和规划中国钟表产业的生态环境，构建中国钟表业&ldquo;有质量的稳定增长、可持续的全面发展&rdquo;的未来之路&nbsp;<br
      />\r\n<br />\r\n<strong>详细议题：</strong>&nbsp;<br />\r\n<br />\r\n<strong>议题一</strong>：&ldquo;开放三十年，成就新时代&rdquo;<br
      />\r\n<strong>议题二</strong>&nbsp;：制造业的未来&mdash;&mdash;&mdash;从&ldquo;比较优势&rdquo;到&ldquo;集聚优势&rdquo;&nbsp;<br
      />\r\n<strong>议题三</strong>：不可或缺的品类&mdash;&mdash;&mdash;奢侈品大爱钟表&nbsp;<br />\r\n<strong>议题四</strong>&nbsp;：电商左右大局&mdash;&mdash;&mdash;改造钟表销售渠道&nbsp;<br
      />\r\n<strong>议题五</strong>&nbsp;：设计成就未来&mdash;&mdash;&mdash;价值的奥妙<br />\r\n&nbsp;</p>\r\n"
