    - "<p><strong>第11届中国钟表高峰论坛</strong></p>\r\n\r\n<p><strong>时间：</strong> 2013年6月26日&nbsp;<br
      />\r\n<br />\r\n<strong>地点：</strong>星河丽思卡尔顿酒店三楼&nbsp;<br />\r\n<br />\r\n<strong>主题：</strong>设计产业未来&nbsp;<br
      />\r\n&nbsp;</p>\r\n\r\n<p>&ldquo;第11届中国钟表高峰论坛&rdquo;云集了业内外专家学者，以不同视角、不同层面，从&ldquo;全球各国制表业的发展现状、科技大发展对钟表行业的长远影响、钟表设计新媒体时代的营销新策略探索、经济环境和政策影响下进口表销售变化和国产表的出路&rdquo;等话题，设计钟表行业的中长期战略。<br
      />\r\n<br />\r\n<strong>详细议题：</strong>&nbsp;<br />\r\n<br />\r\n<strong>议题一&nbsp;</strong>全球钟表业发展现状&nbsp;<br
      />\r\n<strong>议题二&nbsp;</strong>新形势下钟表产业新格局&nbsp;<br />\r\n<strong>议题三</strong>新媒体时代产业营销&nbsp;<br
      />\r\n&nbsp;</p>\r\n"
